[b]Yanagi[/b] (Japanese), [b]Pryce[/b] (English)

Ice-type Gym Leader of Mahogany Town, Johto in [i][[pokemon|Pokémon]][/i] media. Signature Pokémon: [[Piloswine]], [[Mamoswine]].

h4. Variations

* {{pryce_(pokemon) pokemon_gsc}}
** His original appearance, as a Gym Leader, in [i][[pokemon_gsc|GSC]][/i].
* {{pryce_(pokemon) pokemon_hgss}}
** He appears in [i][[pokemon_hgss|HGSS]][/i].
* {{pryce_(pokemon) pokemon_(anime)}}
** He battled against [[Ash Ketchum|Ash]] in [[pokemon_(anime)|the anime]], wearing the clothes depicted in post #1090713 (bottom left).
